import React from 'react';
import "../Style_Components/Header.css";
import logo from './logo.svg';
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from './Button';
import Links from './Header_Links';
const Header = () => {
    return (
        
    <header>
        
        <div className='logo-container'>
          <img src={logo} alt="Logo"></img>  
        </div>
      
        <div className='text-center mt-15'>
           <Links go_to={'/'} name={"Home"} />
           <Links go_to={'/quiz'} name={"Exam"} />
           <Links go_to={'/QuizeInstruction'} name={"About Us"} />
           <Links go_to={'/../Pages/Contact_Us.js'} name={"Contact Us"} />
           <Button name={'Sign in'} />
           <Button name={'Sign up'} />
        </div>
                        

    </header>
        

        

       

    );
};

export default Header;
